pragma solidity >= 0.5.2;

contract textTrans{
  struct trans{
    uint id;
    string name;
  }
  uint nextId = 1;
  trans[] public Trans;

  event transfer(
    uint id,
    string name
  );
  function create(string memory name) public {
    Trans.push(trans(nextId,name));
    nextId++;
  }
  function read(uint id) view public returns(uint,string memory){
    uint i = find(id);
    return (Trans[i].id,Trans[i].name);
  }


  function sendData(uint id,string memory data) public returns(string memory name){
